import './App.css';
//import Paginas from './components/Paginas';
import data from './db.json'
import {Link , BrowserRouter, Route, Routes , useParams} from 'react-router-dom'
import Paginas from './components/Paginas';


function GetEmpresa (){
  let {cliente} = useParams();
  console.log(cliente);
}

function App() {
  return (
    <BrowserRouter>
    <div>
      {data.map((empresa)=>{
        return (
          <Link to={empresa.cliente}>
            <button>
              {empresa.cliente}
            </button>
          </Link>
        )
      })}
      {/* <Paginas /> */}
    </div>
    <Routes>
    <Route path="paginas">
      <Route path=":cliente" element={<Paginas />} />
    </Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;

